import React from "react";
import cn from "classnames";
import "./App.css";

interface Props { }

type Row = [Tile, Tile, Tile, Tile, Tile, Tile, Tile, Tile]

interface Tile {
  d: boolean;
}

type ChessArray = Row[];

const chessArray: ChessArray = [
  [{ d: false }, { d: true }, { d: false }, { d: true }, { d: false }, { d: true }, { d: false }, { d: true }],
  [{ d: true }, { d: false }, { d: true }, { d: false }, { d: true }, { d: false }, { d: true }, { d: false }],
  [{ d: false }, { d: true }, { d: false }, { d: true }, { d: false }, { d: true }, { d: false }, { d: true }],
  [{ d: true }, { d: false }, { d: true }, { d: false }, { d: true }, { d: false }, { d: true }, { d: false }],
  [{ d: false }, { d: true }, { d: false }, { d: true }, { d: false }, { d: true }, { d: false }, { d: true }],
  [{ d: true }, { d: false }, { d: true }, { d: false }, { d: true }, { d: false }, { d: true }, { d: false }],
  [{ d: false }, { d: true }, { d: false }, { d: true }, { d: false }, { d: true }, { d: false }, { d: true }],
  [{ d: true }, { d: false }, { d: true }, { d: false }, { d: true }, { d: false }, { d: true }, { d: false }],
]

// const chessArray = [
//   [0, 1, 2, 3, 4, 5],
// ]

export default (props: Props) => {

  const renderTile = (t: any) => {
    return <React.Fragment>
      <div className={cn("tile", { dark: t.d })}>
        <p>P</p>
      </div>
    </React.Fragment>
  }

  return <React.Fragment>
    <div className="container">
      {chessArray.map(c => (
        <div className="row">
          {c.map(renderTile)}
        </div>
      ))}
    </div>
  </React.Fragment>;
};
